    {
      "lineNumber": 239592,
      "originalJapaneseLine": "　これでも税はちゃんと納めてるのよ」",
      "translatedEnglishLine": "\"Even so, we properly pay our taxes.\""
    },
    {
      "lineNumber": 239593,
      "originalJapaneseLine": "「は、はあ……",
      "translatedEnglishLine": "\"Y-yeah...\""
    },
    {
      "lineNumber": 239594,
      "originalJapaneseLine": "　それは私共に言われましても……」",
      "translatedEnglishLine": "\"Even if you say that to us...\""
    },
    {
      "lineNumber": 239595,
      "originalJapaneseLine": "「こんな辺境でも戦争の影響はあるようだな」",
      "translatedEnglishLine": "\"It seems even in a remote area like this, the war has an impact.\""
    },
    {
      "lineNumber": 239596,
      "originalJapaneseLine": "宿屋の窓から村人達の言い合いを見ていたランスは",
      "translatedEnglishLine": "Rance, who was watching the villagers arguing from the inn's window,"
    },
    {
      "lineNumber": 239597,
      "originalJapaneseLine": "興味を失い、部屋の中に向き直った。",
      "translatedEnglishLine": "lost interest and turned back into the room."
    },
    {
      "lineNumber": 239598,
      "originalJapaneseLine": "「あのぉ、私達、こんな大変な時期に",
      "translatedEnglishLine": "\"Um, at a time this difficult,"
    },
    {
      "lineNumber": 239599,
      "originalJapaneseLine": "　なんで旅をしてたのでしたっけ？」",
      "translatedEnglishLine": "why were we traveling again?\""
    },
    {
      "lineNumber": 239600,
      "originalJapaneseLine": "「美樹ちゃんを見つけないといけないのに、",
      "translatedEnglishLine": "\"We have to find Miki-chan, but"
    },
    {
      "lineNumber": 239601,
      "originalJapaneseLine": "　本当にこのまま旅を続けていいんでしょうか……」",
      "translatedEnglishLine": "is it really okay to keep traveling like this...?\""
    },
    {
      "lineNumber": 239602,
      "originalJapaneseLine": "「昨日もかなみさんが来て、",
      "translatedEnglishLine": "\"Kanami-san came yesterday too,"
    },
    {
      "lineNumber": 239603,
      "originalJapaneseLine": "　早く戻るようにと催促されましたし……」",
      "translatedEnglishLine": "urging us to return quickly...\""
    },
    {
      "lineNumber": 239604,
      "originalJapaneseLine": "「だーから、すぐにクレインちゃんが",
      "translatedEnglishLine": "\"Th-that's why Kurein-chan said"
    },
    {
      "lineNumber": 239605,
      "originalJapaneseLine": "　美樹ちゃんの居場所をばっちり",
      "translatedEnglishLine": "she'll perfectly find where Miki-chan is,"
    },
    {
      "lineNumber": 239606,
      "originalJapaneseLine": "　見つけると言っとるだろうが」",
      "translatedEnglishLine": "right away.\""
    },
    {
      "lineNumber": 239607,
      "originalJapaneseLine": "「…………自信ないのだけど」",
      "translatedEnglishLine": "\"...But I'm not confident about that.\""
    },
    {
      "lineNumber": 239608,
      "originalJapaneseLine": "「んがっ、クレインちゃんがそれを言うな！」",
      "translatedEnglishLine": "\"Gah, Kurein-chan, don't say that!\""
    },
    {
      "lineNumber": 239609,
      "originalJapaneseLine": "「大丈夫、君は盗み聞きの魔女だ。",
      "translatedEnglishLine": "\"It's okay, you're the witch of eavesdropping."
    },
    {
      "lineNumber": 239610,
      "originalJapaneseLine": "　どんな情報でも君は聞ける」",
      "translatedEnglishLine": "You can hear any kind of information.\""
    },
    {
      "lineNumber": 239611,
      "originalJapaneseLine": "「…………期待されても、困る」",
      "translatedEnglishLine": "\"...Even if you expect that, it troubles me.\""
    },
    {
      "lineNumber": 239612,
      "originalJapaneseLine": "「おっと情報と言えば……",
      "translatedEnglishLine": "\"Oh, speaking of information...\""
    },
    {
      "lineNumber": 239613,
      "originalJapaneseLine": "　そろそろシィルの秘密を教えるのだ」",
      "translatedEnglishLine": "\"It's about time I tell you Seale's secret.\""
    },
    {
      "lineNumber": 239614,
      "originalJapaneseLine": "「えうっ！？　そ、それは……！」",
      "translatedEnglishLine": "\"Euh!? Th-that's...!\""
    },
    {
      "lineNumber": 239615,
      "originalJapaneseLine": "「……えーと」",
      "translatedEnglishLine": "\"...Uh,\""
    },
    {
      "lineNumber": 239616,
      "originalJapaneseLine": "「…………嘘です」",
      "translatedEnglishLine": "\"...It's a lie.\""
    },
    {
      "lineNumber": 239617,
      "originalJapaneseLine": "「うそぉ？」",
      "translatedEnglishLine": "\"No way?\""
    },
    {
      "lineNumber": 239618,
      "originalJapaneseLine": "「本当はシィルさんの秘密知りません。",
      "translatedEnglishLine": "\"The truth is, I don't know Seale-san's secret."
    },
    {
      "lineNumber": 239619,
      "originalJapaneseLine": "　本当ですよ」",
      "translatedEnglishLine": "It's true.\""
    },
    {
      "lineNumber": 239620,
      "originalJapaneseLine": "「……果てしなく嘘臭い」",
      "translatedEnglishLine": "\"...That sounds endlessly suspicious.\""
    },
    {
      "lineNumber": 239621,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 239622,
      "originalJapaneseLine": "「まあいいや。",
      "translatedEnglishLine": "\"Well, whatever."
    },
    {
      "lineNumber": 239623,
      "originalJapaneseLine": "　それより今日はもう休むぞ」",
      "translatedEnglishLine": "More importantly, let's rest for today.\""
    },
    {
      "lineNumber": 239624,
      "originalJapaneseLine": "「そして、ぐふふ……",
      "translatedEnglishLine": "\"And, hehehe..."
    },
    {
      "lineNumber": 239625,
      "originalJapaneseLine": "　今日もまた三人でたっぷりとセックスするのだ」",
      "translatedEnglishLine": "Today again, the three of us will have plenty of sex.\""
    },
    {
      "lineNumber": 239626,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 239627,
      "originalJapaneseLine": "「む、なんでマスクをつける。",
      "translatedEnglishLine": "\"Uh, why are you wearing a mask?"
    },
    {
      "lineNumber": 239628,
      "originalJapaneseLine": "　それ可愛くないから外せ」",
      "translatedEnglishLine": "That's not cute, take it off.\""
    },
    {
      "lineNumber": 239629,
      "originalJapaneseLine": "「私にするのなら……",
      "translatedEnglishLine": "\"If it's for me..."
    },
    {
      "lineNumber": 239630,
      "originalJapaneseLine": "　…………シィルさんにどうぞ」",
      "translatedEnglishLine": "...then please give it to Seale-san.\""
    },
    {
      "lineNumber": 239631,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 239632,
      "originalJapaneseLine": "　＜すぅっ……＞",
      "translatedEnglishLine": "<Suu... (breath in)>"
    },
    {
      "lineNumber": 239633,
      "originalJapaneseLine": "「あ、こら、消えるなー！」",
      "translatedEnglishLine": "\"Ah, hey, don't disappear!\""
    },
    {
      "lineNumber": 239634,
      "originalJapaneseLine": "（クレインさん……",
      "translatedEnglishLine": "(Kurein-san..."
    },
    {
      "lineNumber": 239635,
      "originalJapaneseLine": "　本当に私の秘密知らないのかなぁ……）",
      "translatedEnglishLine": "Does she really not know my secret...?)"
    },
    {
      "lineNumber": 239636,
      "originalJapaneseLine": "ランス達が街道をだらだらと歩いていた。",
      "translatedEnglishLine": "Rance and the others were strolling idly down the highway."
    },
    {
      "lineNumber": 239637,
      "originalJapaneseLine": "「うーむ、今日でもう四日目か……」",
      "translatedEnglishLine": "\"Hmm, today is already the fourth day...\""
    },
    {
      "lineNumber": 239638,
      "originalJapaneseLine": "「いえ、五日目です、ランス様」",
      "translatedEnglishLine": "\"No, it's the fifth day, Lord Rance.\""
    },
    {
      "lineNumber": 239639,
      "originalJapaneseLine": "「そろそろ戻った方がいいような……」",
      "translatedEnglishLine": "\"Maybe we should head back soon...\""
    },
    {
      "lineNumber": 239640,
      "originalJapaneseLine": "「うーむ、しかしもう少しで",
      "translatedEnglishLine": "\"Hmm, but maybe soon"
    },
    {
      "lineNumber": 239641,
      "originalJapaneseLine": "　何か盗み聞き成功するかも知れんしなあ」",
      "translatedEnglishLine": "we might succeed in eavesdropping on something.\""
    },
    {
      "lineNumber": 239642,
      "originalJapaneseLine": "「む？　クレインちゃんはどこ行った？」",
      "translatedEnglishLine": "\"Huh? Where did Kurein-chan go?\""
    },
    {
      "lineNumber": 239643,
      "originalJapaneseLine": "「あ、あれ？」",
      "translatedEnglishLine": "\"Ah, huh?\""
    },
    {
      "lineNumber": 239644,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 239645,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 239646,
      "originalJapaneseLine": "「おお、こんなところにいたか。",
      "translatedEnglishLine": "\"Oh, there you are in a place like this."
    },
    {
      "lineNumber": 239647,
      "originalJapaneseLine": "　こら、勝手に俺から離れるんじゃ――」",
      "translatedEnglishLine": "Hey, don't wander off from me without permission--\""
    },
    {
      "lineNumber": 239648,
      "originalJapaneseLine": "「しっ……」",
      "translatedEnglishLine": "\"Shh...\""
    },
    {
      "lineNumber": 239649,
      "originalJapaneseLine": "草むらにいたクレインが",
      "translatedEnglishLine": "Kurein, who was in the grass,"
    },
    {
      "lineNumber": 239650,
      "originalJapaneseLine": "人差し指を口の前に立てた。",
      "translatedEnglishLine": "put her index finger to her lips."
    },
    {
      "lineNumber": 239651,
      "originalJapaneseLine": "そして視線だけで、草むらの向こうを示す。",
      "translatedEnglishLine": "Then, with only her gaze, she pointed beyond the grass."
    }
  ]
}

